import { useEffect } from 'react';
 
//Components
import NavBar from "./NavBar";
import Banner from "./Banner";

import { styled, Box} from '@mui/material';

import { getProducts } from '../../redux/actions/productActions';

const Component = styled(Box)`
   padding: 10px;
   background: #f2f2f2;
`;

const Home = () => {

     useEffect(() => {
        getProducts()
     }, [])

    return(
        <>
        <NavBar/>
        <Component>
        
          <Banner/>
            
        </Component>
        
        </>
    )
}

export default Home;
